import React from 'react'
import { SelectedDetailsState } from "../Context/SelectedDetails";

const PlanPage = () => {
    const {selectedPlan} = SelectedDetailsState();
    const devices = selectedPlan.devices.map((device,id)=>{
        return (device + "+");
    });
    devices = devices.slice(0,-1);
  return (
    <div className="container">
        <div className="box flexCol">
            <div>
                <div className="heading bold large">Current Plan Details</div>
                <span></span>
            </div>
            <div className="regular">Basic</div>
            <div className="opac">
                {
                 devices
                }
            </div>

        </div>
    </div>
  )
}

export default PlanPage
